void Kinematics::convert_jointPos_enc2dh(const int fingerId, const double jointPos_enc[Globals::nq_kins_pf],double jointPos_dh[Globals::nq_kins_pf]) //everything in rad - ok
{
	int res_abs_enc_loc=4096;//joints 1..5 - Reading from 0 to 4096 which corresponds to 2pi. Can count only one turn, then goes back to 0
	//int res_rel_enc_loc=30000;//joint 0 - increment of 30000 represents 2pi - can count several turns.

	//Res other encoders=
	if(fingerId==0) //thumb
	{
	    jointPos_dh[0]=-jointPos_enc[0]+10.8079;//;7.8795;//jointPos_dh[0]=-jointPos_enc[0]+1.654572;
		jointPos_dh[1]=+jointPos_enc[1]-2874*2*M_PI/res_abs_enc_loc;//892 -1.0308
		jointPos_dh[2]=-jointPos_enc[2]+1972*2*M_PI/res_abs_enc_loc;
		jointPos_dh[3]=-jointPos_enc[3]+1890*2*M_PI/res_abs_enc_loc;//5.9304;
		jointPos_dh[4]=-jointPos_enc[4]+2282*2*M_PI/res_abs_enc_loc;
		jointPos_dh[5]=+jointPos_enc[5]-300*2*M_PI/res_abs_enc_loc;
	}
	else if(fingerId==1) //index
	{
	    jointPos_dh[0]=-jointPos_enc[0]+10.708;//jointPos_dh[0]=-jointPos_enc[0]+2.244563;
		jointPos_dh[1]=+jointPos_enc[1]-108*2*M_PI/res_abs_enc_loc;//6.23103 - 54
		jointPos_dh[2]=-jointPos_enc[2]+2894*2*M_PI/res_abs_enc_loc;//4.025166;
		jointPos_dh[3]=-jointPos_enc[3]+1546*2*M_PI/res_abs_enc_loc;//2.549476;
		jointPos_dh[4]=-jointPos_enc[4]+4024*2*M_PI/res_abs_enc_loc;
		jointPos_dh[5]=+jointPos_enc[5]-1742*2*M_PI/res_abs_enc_loc;
	}
	else if(fingerId==2) //middle
	{
	    jointPos_dh[0]=-jointPos_enc[0]+10.750;//jointPos_dh[0]=-jointPos_enc[0]+2.251894
		jointPos_dh[1]=-jointPos_enc[1]+3302*2*M_PI/res_abs_enc_loc;//6.077632
		jointPos_dh[2]=-jointPos_enc[2]+4038*2*M_PI/res_abs_enc_loc;
		jointPos_dh[3]=-jointPos_enc[3]+3006*2*M_PI/res_abs_enc_loc;
		jointPos_dh[4]=-jointPos_enc[4]+3246*2*M_PI/res_abs_enc_loc;
		jointPos_dh[5]=-jointPos_enc[5]+1616*2*M_PI/res_abs_enc_loc;
	}
	else
	{
		printf("ERROR: invalid finger id. Exit. [Kinematics.cpp] \n");
	}
}

