void Kinematics::computeFwdKin(Exoskeleton * pExoskeleton)//Put quat neighbour checking in a fnt
{
	for(int it=0;it<3;it++) //for each finger
	{
		//printf("Finger %i \n",it);

		//dh convention
		Kinematics::convert_jointPos_enc2dh(it, pExoskeleton->aFingers[it].jointPos_enc,pExoskeleton->aFingers[it].jointPos_dh); //set pExoskeleton jointPos_dh
		
		//Kin struct
		Kinematics::get_Xp_base2tip_base(it,pExoskeleton->aFingers[it].jointPos_dh,pExoskeleton->aFingers[it].posTip); //sets pExoskeleton posTip
		Kinematics::get_rot_base2tip_base(it,pExoskeleton->aFingers[it].jointPos_dh,pExoskeleton->aFingers[it].pRotTip); //sets pExoskeleton pRotTip
		Kinematics::get_Jacobian_base2tip_base(it,pExoskeleton->aFingers[it].jointPos_dh,pExoskeleton->aFingers[it].pJacobianTip); //sets pExoskeleton pJacobianTip

		//Orientation description: conversion from rotation matrix to quat and RPY
		MathUtils::RotToRPY(pExoskeleton->aFingers[it].pRotTip, pExoskeleton->aFingers[it].RPY_Tip); //sets pExoskeleton RPY_Tip
		MathUtils::RotToQuat(pExoskeleton->aFingers[it].pRotTip,pExoskeleton->aFingers[it].quatTip_raw);//sets pExoskeleton quatTip_raw

		//Neighbour checking:
		//printf("[Kinematics::computeFwdKin] Check that this works properly during 1st loop (when no previous quat== no neighbour)");
		//Check for first quaternion. If first (initialized to zero) then pick up any of the two valid quaternion. 
		bool is_quat_zero=false;
		if(pExoskeleton->aFingers[it].quatTip[0]==0 && pExoskeleton->aFingers[it].quatTip[1]==0 && pExoskeleton->aFingers[it].quatTip[2]==0 && pExoskeleton->aFingers[it].quatTip[3]==0)
		{
			is_quat_zero=true;
		}

		if(is_quat_zero==true) //Do not check for closest neighbour, take any of the two possible solutions for quat
		{
			//printf("Previous quat is zero, pick up randomly new quat \n");
			MathUtils::RotToQuat(pExoskeleton->aFingers[it].pRotTip,pExoskeleton->aFingers[it].quatTip); //sets pExoskeleton quatTip
		}
		else //if previous quat is not zero (already assigned once) then Compute the two possible solutions quat and -quat from rot matrix ; pick up the closest one from the last quat
		{
			//printf("Previous quat is non zero, pick up closest neighbour \n");
			double prev_quat[4];
			for (int itj=0;itj<4;itj++)
			{
				prev_quat[itj]=pExoskeleton->aFingers[it].quatTip[itj];
			}
			MathUtils::RotToQuat_closestNeighbour(pExoskeleton->aFingers[it].pRotTip,prev_quat,pExoskeleton->aFingers[it].quatTip); //sets pExoskeleton quatTip
		}
		//printf("[Kinematics::ComputeFwdKin] %g %g %g %g \n",pExoskeleton->aFingers[it].quatTip[0],pExoskeleton->aFingers[it].quatTip[1],pExoskeleton->aFingers[it].quatTip[2],pExoskeleton->aFingers[it].quatTip[3]);
	}
}

//TO CHECK - solve rt-nrt thing
void Kinematics::compute_x_dot(Exoskeleton * pExoskeleton)  //user fnt
{
	for(int it=0;it<3;it++)//for each finger
	{
		//Calls adequately internal fnt
		Kinematics::compute_velTip_base(pExoskeleton->aFingers[it].q_dot_dh_nrt,pExoskeleton->aFingers[it].pJacobianTip,pExoskeleton->aFingers[it].velTip_nrt); //nrt - set pExoskeleton velTip
		Kinematics::compute_velTip_base(pExoskeleton->aFingers[it].q_dot_dh_rt,pExoskeleton->aFingers[it].pJacobianTip,pExoskeleton->aFingers[it].velTip_rt); //nrt - set pExoskeleton velTip
	}
}


void Kinematics::project_force2torque(CustomMatrix * p_Jacobian,const double force_tip_des_base[Globals::numVar_pf_for_pcs], double & res_torque_0) //Per finger fnt
//TO CHECK - 
{
	//Project force to apply to fingertip expressed in base frame (obtained from syn computation) to torque space. Extract 1st component of torque, the only one useful since only joint 0 is actuated.
	// torque=J' * F 
	// torque (6x1)=(nq_kins_pf x 1)
	// J (3x6)=(n_pcs x nq_kins_pf)
	// J' (6x3)
	// F (n_pcs x 1)

	//Build vector F 
	CustomMatrix * pF=new CustomMatrix(Globals::numVar_pf_for_pcs,1);
	for(int it=0;it<Globals::numVar_pf_for_pcs;it++)
	{
		(*pF)(it+1,1)=force_tip_des_base[it];
	}

	//Extract submatrix of interest
	CustomMatrix * pJ=new CustomMatrix(Globals::numVar_pf_for_pcs,Globals::nq_kins_pf);//Reduced jacobian (3x6)
	for(int iti=0;iti<Globals::numVar_pf_for_pcs;iti++)
	{
		for(int itj=0;itj<Globals::nq_kins_pf;itj++)
		{
			(*pJ)(iti+1,itj+1)=(*p_Jacobian)(iti+1,itj+1);
		}
	}
	
	//Jacobian transpose
	CustomMatrix * pJ_transpose=pJ->transpose();

	//Torque=J_transpose * F
	CustomMatrix * pTorque=CustomMatrix::MatrixProduct(pJ_transpose,pF);
	//printf("[Kinematics::project_force2torque] Torque (should be nq_kins_pf x 1 = 6x1)\n");
	//pTorque->printf_Matrix();

	//Extract torque first joint and set arg
	res_torque_0=(*pTorque)(1,1);
}

//CHECK
void Kinematics::compute_torque_ref(Exoskeleton * pExoskeleton) //To check - force ref should have been set previously
{
	double tau0_ref_loc; //Nm
	int tau0_ref_motorRange_loc[3];//mNm
	for(int it=0;it<3;it++) //for each finger
	{
		Kinematics::project_force2torque(pExoskeleton->aFingers[it].pJacobianTip,pExoskeleton->aFingers[it].force_tip_des_base, tau0_ref_loc);	//sets torque ref Nm
		if(it==0)
		{
			tau0_ref_loc=tau0_ref_loc*2;//increase torque thumb
		}
		tau0_ref_motorRange_loc[it]=Exoskeleton::scaleTorque_to_motorRange( tau0_ref_loc);//mNm
	}
   pExoskeleton->set_torque0_ref(tau0_ref_motorRange_loc);//mNm
	//printf("[Kinematics::compute_torque_ref] Torque joint 0 - Finger 0: %g \t Finger 1: %g \t Finger 2: %g \n",pExoskeleton->aFingers[0].torque_0_ref,pExoskeleton->aFingers[1].torque_0_ref,pExoskeleton->aFingers[2].torque_0_ref);
}

void Kinematics::compute_velTip_base(const double q_dot_dh[Globals::nq_kins_pf],CustomMatrix * p_Jacobian, double res_velTip[Globals::mCart_kins_pf]) //internal fnt
{
	//PUT SOME DIM CHECKS..

	//Construct q_dot matrix
	CustomMatrix * p_q_dot=new CustomMatrix(Globals::nq_kins_pf,1);
	for(int it=0;it<Globals::nq_kins_pf;it++)
	{
		(*p_q_dot)(it+1,1)=q_dot_dh[it];
	}

	//Matrix product: x_dot=J*q_dot with J=mxn, q_dot=nx1, x_dot=[vx vy vz wx wy wz]'=mx1
	CustomMatrix * p_velTip=CustomMatrix::MatrixProduct(p_Jacobian,p_q_dot);

	//Set arg
	for(int it=0;it<Globals::mCart_kins_pf;it++)
	{
		res_velTip[it]=(*p_velTip)(it+1,1);
	}

}



